import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import NavBar from '../components/NavBar.jsx';
import Jumbotron from '../components/Jumbotron.jsx';




export default class StepBuilderNav extends Component{
    render(){
        return(
            <div>
              <NavBar StepBuilder="nav-item active" />
              <Jumbotron title="Character Builder Helper" subtitle="Step by Step guide"/>

              <button>
                 <Link to="/StepBuilderRace">Race</Link>   
                </button>

              <button>
                <Link to="/StepBuilderProf">Proficiencies</Link>  
                </button>

                <button>
                  <Link to="/StepBuilder">Stats</Link>
                </button>
              </div>
        );
    }
}
